datosEmpleoCargoComision.funcionPrincipal:
COORDINAR LA RECEPCIÓN, REGISTRO Y CUSTODIA DE LAS DECLARACIONES DE SITUACIÓN PATRIMONIAL Y DE INTERESES DE LOS DIPUTADOS Y SERVIDORES PÚBLICOS DEL PODER LEGISLATIVO, ASÍ COMO EL PROCESO PARA SU VERIFICACIÓN A TRAVÉS DE SU EVOLUCIÓN PATRIMONIAL;
SUPERVISAR LA RECEPCIÓN DE LAS DENUNCIAS EN MATERIA DE SITUACIÓN PATRIMONIAL, EVOLUCIÓN PATRIMONIAL Y DE CONFLICTO DE INTERÉS, FORMULADAS EN CONTRA DE LOS DIPUTADOS, SERVIDORES PÚBLICOS DEL PODER LEGISLATIVO Y DE ELECCIÓN POPULAR MUNICIPAL;
VERIFICAR QUE SE INSTAURE EL PROCEDIMIENTO DE RESPONSABILIDAD ADMINISTRATIVA CONTENIDO EN LA LEY DE RESPONSABILIDADES ADMINISTRATIVAS DEL ESTADO DE MÉXICO Y MUNICIPIOS, TRATÁNDOSE DE DIPUTADOS, SERVIDORES PÚBLICOS DEL PROPIO PODER LEGISLATIVO Y DE ELECCIÓN POPULAR MUNICIPAL, DE CONFORMIDAD CON LA COMPETENCIA QUE AL RESPECTO LE OTORGA LA MISMA LEY;
COORDINAR Y VIGILAR LA APLICACIÓN DEL PROCEDIMIENTO DE ENTREGA-RECEPCIÓN DE LA PRESIDENCIA DE LA JUNTA DE COORDINACIÓN POLÍTICA, ASÍ COMO DE LAS DEPENDENCIAS Y UNIDADES ADMINISTRATIVAS DEL PODER LEGISLATIVO, A EFECTO DE QUE SE CUMPLA CON LA NORMATIVIDAD ESTABLECIDA; 
RECIBIR, REGISTRAR, CUSTODIAR Y VERIFICAR LAS DECLARACIONES DE SITUACIÓN PATRIMONIAL Y DE INTERESES, EN SU CASO, DE LA CONSTANCIA DE PRESENTACIÓN DE LA DECLARACIÓN FISCAL DE LOS DIPUTADOS Y SERVIDORES PÚBLICOS DEL PODER LEGISLATIVO; Y

ARTÍCULO 72. LA O EL SECRETARIO GENERAL DEL PLENO TENDRÁ LAS ATRIBUCIONES Y DEBERES SIGUIENTES:

I.	ACORDAR CON LA O EL PRESIDENTE DEL TRIBUNAL, LOS ASUNTOS DE SU COMPETENCIA;

II.	ELABORAR Y FIRMAR, LAS ACTAS DE LAS SESIONES DEL PLENO DE LA SALA SUPERIOR, AUTORIZADAS POR LA O EL PRESIDENTE DEL TRIBUNAL;

III.	DAR CUENTA EN LAS SESIONES DEL PLENO DE LOS ASUNTOS A TRATAR, REGISTRAR LA VOTACIÓN DE LAS Y LOS MAGISTRADOS Y COMUNICAR LAS DECISIONES QUE SE ACUERDEN;

IV.	DAR FE Y FIRMAR LAS ACTAS, ACUERDOS Y ACTUACIONES DEL PLENO;

V.	EXPEDIR CERTIFICACIONES DE LAS CONSTANCIAS QUE OBREN EN LAS ACTAS DEL PLENO, SOLICITADAS POR QUIEN ACREDITE TENER INTERÉS JURÍDICO O LEGÍTIMO;

VI.	ELABORAR LOS PROYECTOS DE RESOLUCIÓN Y LOS QUE SE DETERMINEN SI EXISTE CONTRADICCIÓN DE TESIS ENTRE LAS SUSTENTADAS EN LAS SALAS REGIONALES DE JURISDICCIÓN ORDINARIA, ESPECIALIZADAS EN MATERIA DE RESPONSABILIDADES ADMINISTRATIVAS O LAS SECCIONES DE LA SALA SUPERIOR, EN TÉRMINOS DEL CÓDIGO DE PROCEDIMIENTOS;

VII.	ASISTIR Y PARTICIPAR EN LOS EVENTOS A LOS CUALES SEA COMISIONADO POR LA PRESIDENCIA DEL TRIBUNAL Y DE LA JUNTA;

VIII.	FUNGIR COMO SECRETARIO TÉCNICO DE LA JUNTA; Y

IX.	LAS DEMÁS QUE LE SEAN ASIGNADAS POR LAS DISPOSICIONES LEGALES APLICABLES Y POR EL PLENO Y LA JUNTA.
